import React, { useContext } from 'react';
import { ThemeContext } from '../Contexts';
import Main from '../components/Main';

function Home({ term }) {
  const { theme } = useContext(ThemeContext);

  return (
    <div style={{ backgroundColor: theme === 'light' ? '#f8f9fa' : '#343a40', color: theme === 'light' ? 'black' : 'white' }}>
      <Main term={term} />
    </div>
  );
}

export default Home;
